dando pequenos passos, sei que eu posso ir mais longe. // Taking small steps I know I can go further. 

///// This piece is from the collection "descartável", which is a audiovisual project that I discarded bad feelings and turned it into something that could heal me. Pieces were taken from my music album self produced that addresses mental health issues and self knowledge. This is the sixth piece of the collection. 

